import { useTranslation } from "react-i18next";



const PageHome = () => {
    const { t } = useTranslation();
    return (
        <>
            <TitleHead></TitleHead>
            <NavBar>{<GroupInputHome></GroupInputHome>}</NavBar>
            {/* this is home */}
            <InputIamge></InputIamge>
        </>
    );
};

export default PageHome;
